window.bookSummaryJSON = "<p>Cashel Blackthorne took me captive.</p> <p>I hated him. <br> </p> <p>I wanted him. <br> </p> <p>I fell for him.</p> <p>Then everything I knew changed. I got away from the Blackthorne vampires, but they still want my blood. Living a nomadic life with a band of hunters, I learned how to fight and how to defend myself. </p> <p>Now, I'm torn between the deep feelings I've developed for my captor and the new attraction I have for Logan, the rugged hunter who came for me. </p> <p>Cashel Blackthorne may have taken my heart, but he also taught me a lesson.... </p> <p>Never trust a vampire.</p> <p><b>Contains mature themes.</b></p>"; 
